Требуемый опыт работы: 1–3 года

Полная занятость, гибкий график

Обязанности:

Участие в создании и развитии серверной части наших приложений;
Работа с высоконагруженными сервисами;
Поддержка и развитие существующих решений - бэкенд, базы данных, очереди задач;
Оптимизация приложений и внедрение лучших практик в кодовую базу.
Требования:

Опыт разработки на Python;
Общее понимание принципов ООП;
Базовое знание SQL и опыт работы с базами данных;
Плюсом будет работа с ОС Linux на уровне продвинутого пользователя;
Приветствуется опыт работы с Git.
Условия:

Гибкий график;
Повышение заработной платы на 10.000 рублей каждые полгода;
Apple техника (macbook pro + 4K монитор);
Горячие обеды, фрукты, кофе, чай, шоколадки, печенье;

Комфортный офис в 3 минутах от м. Курская (БЦ «Мельницкий»);

Компенсируем оплату за переезд (первый месяц проживания в Москве за наш счет);
Своевременная выплата зарплат, оформление по ТК.

Требования:

Опыт разработки мобильных приложений для платформы Android от 3-х лет;

“Портфолио” твоих Android-проектов, на которое мы будем рады взглянуть.
Коротко о тебе:

знаешь и уверенно кодишь на Java/Kotlin;

можешь грамотно построить архитектуру приложения с нуля;

понимаешь особенности разработки клиент-серверных приложений.

Большим плюсом будет:

опыт работы с рекламным SDK;

взаимодействие с социальными сетями.

Мы предлагаем:

принять участие в работе над успешными проектами, конкурентами которых являются лучшие продукты сегмента на мировом рынке;

возможность сделать продукт, которым можно гордиться;

работу в команде профессионалов мирового уровня;

высокий уровень заработной платы (обсуждается с успешным кандидатом);

приятные мелочи для комфортной и продуктивной работы: гибкий график работы, корпоративные мероприятия, развлечения, и пр.;

трудоустройство согласно ТК РФ;

возможность работать из любой точки мира.
